import axios from "axios";

const getTestUser = async () => {
    try {
        const res = await axios("http://centerbeam.proxy.rlwy.net:22111/api/user");
        console.log(res.data);
    } catch (err) {
        console.error("Error getting user:", err);
    }
};

export default getTestUser;
